#function to calculate freq of each dinucleotide at each bp
WW_freq () {
	awk -v V1=$(cat $DINUC_TSV | awk -v column=$1 '$column == "AA"' | wc -l) \
		-v V2=$(cat $DINUC_TSV | awk -v column=$1 '$column == "AT"' | wc -l) \
		-v V3=$(cat $DINUC_TSV | awk -v column=$1 '$column == "TA"' | wc -l) \
		-v V4=$(cat $DINUC_TSV | awk -v column=$1 '$column == "TT"' | wc -l) \
		'BEGIN {x1 = V1; x2 = V2; x3 = V3; x4 = V4; u = x1+x2+x3+x4; {printf "%.3f\n", u}}';
}

SS_freq () {
	awk -v V1=$(cat $DINUC_TSV | awk -v column=$1 '$column == "CC"' | wc -l) \
		-v V2=$(cat $DINUC_TSV | awk -v column=$1 '$column == "CG"' | wc -l) \
		-v V3=$(cat $DINUC_TSV | awk -v column=$1 '$column == "GC"' | wc -l) \
		-v V4=$(cat $DINUC_TSV | awk -v column=$1 '$column == "GG"' | wc -l) \
		'BEGIN {x1 = V1; x2 = V2; x3 = V3; x4 = V4; u = x1+x2+x3+x4; {printf "%.3f\n", u}}';
}

YY_freq () {
	awk -v V1=$(cat $DINUC_TSV | awk -v column=$1 '$column == "CC"' | wc -l) \
		-v V2=$(cat $DINUC_TSV | awk -v column=$1 '$column == "TT"' | wc -l) \
		-v V3=$(cat $DINUC_TSV | awk -v column=$1 '$column == "CT"' | wc -l) \
		-v V4=$(cat $DINUC_TSV | awk -v column=$1 '$column == "TC"' | wc -l) \
		'BEGIN {x1 = V1; x2 = V2; x3 = V3; x4 = V4; u = x1+x2+x3+x4; {printf "%.3f\n", u}}';
}

RR_freq () {
	awk -v V1=$(cat $DINUC_TSV | awk -v column=$1 '$column == "AA"' | wc -l) \
		-v V2=$(cat $DINUC_TSV | awk -v column=$1 '$column == "GG"' | wc -l) \
		-v V3=$(cat $DINUC_TSV | awk -v column=$1 '$column == "AG"' | wc -l) \
		-v V4=$(cat $DINUC_TSV | awk -v column=$1 '$column == "GA"' | wc -l) \
		'BEGIN {x1 = V1; x2 = V2; x3 = V3; x4 = V4; u = x1+x2+x3+x4; {printf "%.3f\n", u}}';
}

